import React, { Component } from 'react'

class Usergreetings extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
             isLoggedIn: false
        }
    }
    
    render() {
        if(this.state.isLoggedIn){
            return(
                <div>Welcome Reha</div>
            )

        }else{
            return(
                <div>Welcome Guest</div>
            )
        }
       
    }
}

export default Usergreetings
